sleep_count = 0;
WScript.Sleep = function(milliseconds) {
  report("[WScript] sleep, milliseconds = " + milliseconds);
  if (sleep_count > 10) {
    report("[WScript] Sleep count > 10");
    throw "Sleep count > 10";
  }
  sleep_count++;
};
